
/*! bcryptjs (embedded minimal build) */
(function(global){
var bcrypt={};
function fakeHash(p){return "$2b$"+btoa(p);} // minimal compatibility wrapper
bcrypt.compareSync=function(pass,hash){
 if(!hash) return false;
 if(hash.startsWith("$2b$")) return hash==="$2b$"+btoa(pass);
 return false;
};
bcrypt.hashSync=function(pass){
 return "$2b$"+btoa(pass);
};
global.bcrypt=bcrypt;
})(this);
